const Content = ({ parts }) => {
    return (
        <div>
            {parts.map(part => (
                <Part key={parts.id} name={parts.name} exercise={parts.exercise} />
            ))}
        </div>
    )

    const Part = ({ name, exercise }) => {
        return (
            <p>
                {name} {exercise}
            </p>
        )
    }

}


export default Content
